member.param:
The path of the directory to search for files in.
            Can start with one of these macros:
               {CommonClientSounds}
               {Compound}
               {Customization}
               {DebriefViewer}
               {DefaultScenario}
               {EventUserBase}
               {Handlers}
               {LocalProduct}
               {LocalServer}
               {PhSample}
               {Profiles}
               {Progress}
               {Restarted}
               {Sample}
               {ScenarioEditor}
               {Scenario}
               {ScenarioTemp}
               {ServerBase}
               {TmpDebrief}
               {TmpServer}
               {TrendEditor}
               {Trends}
               {UserBase}
               {UserDataCommon}
               {UserData}
               {Video}
               {VocalSoundBreathing}
               {VocalSounds}
               {XML}
               {XRay}

            Thus if you specify "{LocalProduct}\Logs" you will get all files in the
            server log directory "C:\Documents and Settings\USER\My Documents\SimMan3G\Server\Logs"
